import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

const Banner = ({}: Props) => {
  return (
    <Styled.MainBanner>
      <Styled.Title fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Title>
    </Styled.MainBanner>
  )
};

export default Banner;
